<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Server Error | Keppel Land</title>
    <style>
        body {
            width: 100%;
            height: 100vh;
            overflow: hidden;
            color: #FFF;
            background-color: #1e1f21;
            font-family: sans-serif;
        }

        #error-page-wrapper {
            display: flex;
            flex-direction: column;
            height: 100%;
        }

        .container, .container.col-12 {
            padding-right: 15px;
            padding-left: 15px;
            margin-right: auto;
            margin-left: auto
        }

        header {
            background-color: #0c0404;
            padding: 20px 0;
        }

        main {
            display: flex;
            flex-direction: column;
            align-content: center;
            justify-content: center;
            flex: 1;
            text-align: center;
        }

        img.logo {
            width: 200px;
            height: auto;
        }

        .error-title {
            font-size: 40px;
            margin: 40px auto 10px auto;
        }

        .error-subtitle {
            font-size: 24px;
            margin-bottom: 16px;
        }

        .error-image {
            max-width: 350px;
            text-align: center;
            margin: auto;
        }

        .error-image img {
            width: 100%;
            height: auto;
        }
        p {
            font-size: 16px;
        }
        @media (min-width: 576px) {
            .container, .container.col-12 {
                max-width: calc(540px - 0px)
            }
            .error-subtitle {
                font-size: 40px;
                margin-bottom: 32px;
            }
        }

        @media (min-width: 768px) {
            .container, .container.col-12 {
                max-width: calc(720px - 0px)
            }
            .error-title {
                font-size: 80px;
            }

        }

        @media (min-width: 992px) {
            .container, .container.col-12 {
                max-width: calc(960px - 0px)
            }
        }

        @media (min-width: 1200px) {
            .container, .container.col-12 {
                max-width: calc(1140px - 0px)
            }
        }

        @media (min-width: 1440px) {
            .container, .container.col-12 {
                max-width: calc(1140px - 0px)
            }
        }

        @media (min-width: 1921px) {
            .container, .container.col-12 {
                max-width: calc(1140px - 0px)
            }
        }

        @media (min-width: 2561px) {
            .container, .container.col-12 {
                max-width: calc(1140px - 0px)
            }
        }
    </style>
</head>
